import React from "react"

class Comp extends React.Component{
    constructor(props){
    super(props);
    this.state ={
        name:"Vasile",
        age : "20",
        isLoggedIn : false,
        loggMsg : ""
        };  
    }
    loginCheck () {
        if(this.state.isLoggedIn === false)
            this.state.loggMsg = "out"
        else
            this.state.loggMsg = "in"
        return this.state.loggMsg;
        console.log(this.state.loggMsg);
    }
    render()
    {
        return(
            <div>
                <p>Comp</p>
                <h1>Nume:{this.state.name}</h1>
                <h2>Age:{this.state.age}</h2>
                <h3>Logging:{this.loginCheck}</h3>
            </div>
        )
    }
}

export default Comp
